import React from "react";
import "./works.css";
import StreetEatz from "../../assets/streeteatz.png";
import DraftMadness from "../../assets/draftmadness.png";
import Portfolio3 from "../../assets/portfolio-3.png";
import Portfolio4 from "../../assets/portfolio-4.png";
import Portfolio5 from "../../assets/portfolio-5.png";
import Portfolio6 from "../../assets/portfolio-6.png";

const Works = () => {
  return (
    <section id="works">
      <h2 className="worksTitle">My Portfolio</h2>
      <span className="workDesc">Demo text...</span>
      <div className="worksImgs">
      <a href="https://github.com/StreetEatz" target="_blank" rel="noopener noreferrer">
          <img src={StreetEatz} alt="StreetEatz Project" className="worksImg" />
      </a>
      <a href="https://github.com/ithill22/draft_madness_be" target="_blank" rel="noopener noreferrer">
          <img src={DraftMadness} alt="Draft Madness Project" className="worksImg" />
      </a>
          <img src={Portfolio3} alt="worksImg" className="worksImg" />
          <img src={Portfolio4} alt="worksImg" className="worksImg" />
          <img src={Portfolio5} alt="worksImg" className="worksImg" />
          <img src={Portfolio6} alt="worksImg" className="worksImg" />
      </div>
      <button className="workBtn">See More</button>
    </section>
  );
}

export default Works;
